import React from 'react'
import { connect } from 'react-redux'
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts'

const data = [
      {name: '', uv: 'DEEP', pv: 2400, amt: 2400},
      {name: '', 'LIGHT': 3000, pv: 1398, amt: 2210},
      {name: '', uv: 'REM', pv: 9800, amt: 2290},
      {name: '12', uv: 'AWAKE', pv: 3908, amt: 2000},
      {name: '5', uv: 'LIGHT', pv: 4800, amt: 2181},
      {name: '6', uv: 'AWAKE', pv: 3800, amt: 2500},
      {name: '9', uv: 'DEEP', pv: 4300, amt: 2100},
]

class LineGraph extends React.Component {
  render() {

    console.log(this.props.sleep)

  	return (
    	<LineChart width={500} height={300} data={data}
            margin={{top: 5, right: 30, left: 20, bottom: 5}}>
       <XAxis dataKey='name'/>
       <YAxis/>
       <CartesianGrid strokeDasharray="3 3"/>
       <Tooltip/>
       <Legend />
       <Line type='monotone' dataKey='pv' stroke="#8884d8" activeDot={{r: 8}}/>
       <Line type='monotone' dataKey='uv' stroke="#82ca9d" />
      </LineChart>
    )
  }
}

const mapStateToProps = (state) => {
  return {
    sleep: state.user.sleep
  }
}

export default connect(mapStateToProps)(LineGraph)
